import React from "react";
import ReactDOM from "react-dom";
import notes from "../notes";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";



function App(){
    return <div>
        <Header />
        {notes.map((notesss) => <Note 
          key = {notesss.key}
          name = {notesss.title}
          content = {notesss.content}  
        />    
        )};
        <Footer />

    </div>
}

export default App;
